import React, {Component} from 'react';
// import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
// import { geocoder, google, map } from "react-geocode";
import { Map, GoogleApiWrapper } from 'google-maps-react';
import Marker from './Marker'

// const mapStyles = {
//   width: '70%',
//   height: '70%',
// };

export class MapContainer extends Component {
  constructor(props) {
    super(props);
    this.state = {
      stores: [{lat: 39.8283, lng: -98.5795},
              {latitude: 56.1304, longitude: -106.3468},
              {latitude: 39.8283, longitude: -98.5795},
              {latitude: 61.5240, longitude: 105.3188}]
    }
  }

  displayMarkers = () => {
    return this.state.stores.map((store, index) => {
      return <Marker key={index} id={index} 
        position={{
          lat: store.latitude,
          lng: store.longitude
     }}
     onClick={() => console.log("You clicked me!")} />
    })
  }

  render() {
    return (
        <div style={{ height: '50%', width: '80%' }}>
          <Map
            google={this.props.google}
            zoom={1}
            // style={mapStyles}
            initialCenter={{ lat: 39.8283, lng: -98.5795}}
          >
            <Marker
              // lat={39.8283}
              // lng={-98.5795}
              position={{ lat: 48.00, lng: -122.00}}
              name="My Marker"
              color="red"
            />
          </Map>
        </div>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyCW_Vioa3QR3TUnN6MuFdprCqabI055FZk'
})(MapContainer);

